import React from "react";
import { NavLink } from "react-router-dom";
import DropdownButton from "react-bootstrap/DropdownButton";
import Dropdown from "react-bootstrap/Dropdown";
import "../Headers/headers.css";

const handleLogout = () => {
  localStorage.removeItem("token");
  window.location.reload();
};

const AuthenticatedNav = () => {
  return (
    <div className="menu transparent-menu">
      <div className="name">
        {/* <h3>LOST AND FOUND SYSTEM</h3> */}
      </div>
      <nav className="menuitems">
        <ul className="nav-list">
          <li>
            <NavLink to="/ItemList" className="nav-menu nav-menu-animated">
              <i className="fa-solid fa-circle-info"></i>Lost & Found
            </NavLink>
          </li>
          <li>
            <NavLink to="/Contact" className="nav-menu nav-menu-animated">
              <i className="fa-solid fa-image"></i>Contact Us
            </NavLink>
          </li>
          <li>
            <DropdownButton
              id="dropdown-basic-button"
              title={<i className="fa-solid fa-user navbar-icon"></i>}
            >
              <Dropdown.Item href="/profile">
                My Profile
              </Dropdown.Item>
              <Dropdown.Item href="/gallary">
                My Lost and Found Items
              </Dropdown.Item>
              <Dropdown.Item onClick={handleLogout}>Logout</Dropdown.Item>
            </DropdownButton>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default AuthenticatedNav;
